import React from 'react'
import { Container } from 'react-bootstrap'
import isLogin from '../Auth';

export default function Header() {

    if(isLogin){
        console.log('is login');
    }
    else{
        console.log('not login');
    }
    
    if(localStorage.getItem('isLoggedIn') == 'true'){
        return (
            <ul className="list-group list-group-horizontal">
                <li className="list-group-item"><a href="/dashboard" class="head-links">Dashboard</a></li>
                <li className="list-group-item"><a href="/logout" class="head-links">Logout</a></li>
            </ul>
        )
    }
    else{
        return (
            <ul className="list-group list-group-horizontal">
                <li className="list-group-item"><a href="/login" class="head-links">Login</a></li>
            </ul>
        )
    }
}
